// import React from "react";

// export default function Users() {
//     return (
//         <div>
//             <div> Users </div>
//         </div>
//     )
// }

import React from 'react';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';
import IsoIcon from '@mui/icons-material/Iso';
import PeopleAltIcon from '@mui/icons-material/PeopleAlt';
import axios from "axios";

const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
        backgroundColor: '#808080',
        color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
        fontSize: 14,
    },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
        backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
        border: 0,
    },
}));

function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
}

const rows = [
    createData('Karan A', 'prabha@a.com', '2024-06-21 10:40:12.617', '2024-06-21 10:40:12.617', 'Active'),
    createData('Super Admin', 'superadmin@gmail.com', '2024-06-21 10:40:12.617', '2024-06-21 10:40:12.617', 'Disabled'),
    createData('Karan', 'prabha@a.com', '2024-06-21 10:40:12.617', '2024-06-21 10:40:12.617', 'Active'),
    createData('Prabhaka', 'admin@a.com', '2024-06-21 10:40:12.617', '2024-06-21 10:40:12.617', 'Disabled'),
    createData('karan boase', 'karkar@bose.com', '2024-06-21 10:40:12.617', '2024-06-21 10:40:12.617', 'Active'),
];



export default function Users() {

    const [userList, setUserList] = React.useState([]);
    console.log(userList,"userlist");

    React.useEffect(() => {
        UserList();
    },[]);


    function UserList() {
        const data = {
            LoginToken: localStorage.getItem('auth'),
        }
        const url = 'https://localhost:44374/api/User/userList';
        axios.post(url, data).then((result) => {
            console.log(result.data);
            setUserList( result.data);
        })
    }


    console.log(userList,"userlist-end");
    
    console.log(rows,"rows");
    return (
        <div>
            <span >
                <span style={{ display: 'flex' }}><div><PeopleAltIcon color="secondary" sx={{ mt: 0.8, mr: 1 }} /></div><div style={{ fontSize: "23px" }}>Users List</div></span>
                <Button variant="contained" color="secondary" sx={{ width: '40vh', borderRadius: '30px', ml: '155vh', my: 2 }}>
                    <div style={{ marginRight: '2vh' }}>Activate/Disable User</div> <IsoIcon />
                </Button>
            </span>
            <TableContainer component={Paper}>
                <Table sx={{ minWidth: 700 }} aria-label="customized table">
                    <TableHead>
                        <TableRow>
                            <StyledTableCell>Name</StyledTableCell>
                            <StyledTableCell align="left">Email</StyledTableCell>
                            <StyledTableCell align="left">Active&nbsp;From</StyledTableCell>
                            <StyledTableCell align="left">Last&nbsp;Login</StyledTableCell>
                            <StyledTableCell align="left">Status</StyledTableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {userList.map((row) => (
                            <StyledTableRow key={row.Name}>
                                <StyledTableCell component="th" scope="row">
                                    {row.Name}
                                </StyledTableCell>
                                <StyledTableCell align="left">{row.Email}</StyledTableCell>
                                <StyledTableCell align="left">{row.ActiveFrom}</StyledTableCell>
                                <StyledTableCell align="left">{row.LastLogin == 'null' ? 'NILL' : row.LastLogin}</StyledTableCell>
                                <StyledTableCell align="left">{row.Status == 1 ? "Active" : "Disabled"}</StyledTableCell>
                            </StyledTableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </div>
    );
}
